import React from 'react';
import './Sidebar.css';

const Sidebar = (props) =>
{
  const stuff = ['home', 'about me', 'contact','stream','misc'];
  const list = stuff.map((el,i) => <p key={i}>{el}</p>);
    return (
        <div className="Sidebar">
          {list}
        </div>
    );
}

export default Sidebar
